import React from 'react';

const LoginCerberus = () => {
  let intro = {
    svg: '/logo/Cerberus_logo.svg',
    name: 'cerberus'
  };

  return (
    <div className="login">
      <div className="intro">
        <img src={process.env.PUBLIC_URL + intro.logo.svg} alt="" width="200px"/>
      </div>
      <form id="login"></form>
    </div> 
    );
}

export default LoginCerberus;
